import React from "react";
import { Col, Row } from "../../components/Grid";
import Image from "react-bootstrap/Image";
import { MDBMask, MDBView, MDBContainer, MDBRow, MDBCol } from "mdbreact";
import "./style.css"

function Project(props) {
    return (
        // <Col size="md-6">
        //     <Row>
        //         <Col size="md-12">
        //             <h3 className="center pad"><a href={props.git} target="_blank" rel="noreferrer">{props.name}</a></h3>
        //         </Col>
        //     </Row>
        //     <Row className="justify-content-md-center">
        //         <Col size="md-12" style={{ margin: "auto" }}>
        //             <a href={props.app} target="_blank" rel="noreferrer">
        //                 <MDBView hover zoom>
        //                     <Image
        //                         src={props.gif}
        //                         alt={props.name}
        //                         className="d-block mx-auto img-fluid w-75 image-crop"
        //                         thumbnail
        //                     />
        //                     <MDBMask overlay="red-slight">
        //                     </MDBMask>
        //                 </MDBView>
        //             </a>
        //         </Col>
        //     </Row>
        // </Col>

        <MDBContainer className="mt-5">
            <MDBRow>
                <MDBCol md="4">
                    <MDBView hover>
                        <img
                            src="https://mdbootstrap.com/img/Others/documentation/forest-sm-mini.jpg"
                            className="img-fluid"
                            alt=""
                        />
                        <MDBMask className="flex-center" overlay="red-strong">
                            <p className="white-text">Strong overlay</p>
                        </MDBMask>
                    </MDBView>
                </MDBCol>
                <MDBCol md="4">
                    <MDBView hover>
                        <img
                            src="https://mdbootstrap.com/img/Others/documentation/forest-sm-mini.jpg"
                            className="img-fluid"
                            alt=""
                        />
                        <MDBMask className="flex-center" overlay="red-light">
                            <p className="white-text">Light overlay</p>
                        </MDBMask>
                    </MDBView>
                </MDBCol>
                <MDBCol md="4">
                    <MDBView hover>
                        <img
                            src="https://mdbootstrap.com/img/Others/documentation/forest-sm-mini.jpg"
                            className="img-fluid"
                            alt=""
                        />
                        <MDBMask className="flex-center" overlay="red-slight">
                            <p className="white-text">Super light overlay</p>
                        </MDBMask>
                    </MDBView>
                </MDBCol>
            </MDBRow>
            <MDBRow className="mt-4">
                <MDBCol md="6">
                    <MDBView hover zoom>
                        <img
                            src="https://mdbootstrap.com/img/Others/documentation/img%20(131)-mini.jpg"
                            className="img-fluid"
                            alt=""
                        />
                        <MDBMask className="flex-center">
                            <p className="white-text">Zoom effect</p>
                        </MDBMask>
                    </MDBView>
                </MDBCol>
                <MDBCol md="6">
                    <h5 className="text-center">Shadow effect</h5>
                    <img
                        src="https://mdbootstrap.com/img/Others/documentation/4.jpg"
                        className="img-fluid rounded-circle hoverable"
                        alt=""
                    />
                </MDBCol>
            </MDBRow>
        </MDBContainer>
    )
}

export default Project;
